import axios from 'axios';
import { reset } from 'redux-form';
import history from '../history';
import { GET_DATAS, GET_DATA, ADD_DATA, DELETE_DATA, EDIT_DATA } from './types';

// GET project
export const getDATAS = () => async dispatch => {
  const res = await axios.get('http:localhost:8000/api/project/');
  dispatch({
    type: GET_DATAS,
    payload: res.data
  });
};

// GET DATA
export const getDATA = id => async dispatch => {
  const res = await axios.get(`/api/project/${id}/`);
  dispatch({
    type: GET_DATA,
    payload: res.data
  });
};

// ADD DATA
export const addDATA = formValues => async dispatch => {
  const res = await axios.post('/api/project/', { ...formValues });
  dispatch({
    type: ADD_DATA,
    payload: res.data
  });
  dispatch(reset('DATAForm')); //
};

// DELETE DATA
export const deleteDATA = id => async dispatch => {
  await axios.delete(`/api/project/${id}/`);
  dispatch({
    type: DELETE_DATA,
    payload: id
  });
  history.push('/');
};

// EDIT DATA
export const editDATA = (id, formValues) => async dispatch => {
  const res = await axios.patch(`/api/project/${id}/`, formValues);
  dispatch({
    type: EDIT_DATA,
    payload: res.data
  });
  history.push('/');
};
